export const DailyForecast = (props) => {
    const nums = [0, 1, 2, 3, 4, 5, 6, 7]
    const daily = nums.map((num) => num)

    console.log(daily)

    return (
        <div className="days_forecast">
            <div className={props.isToggle ? 'day_weather dark_mode_right_card' : 'day_weather'}>
                <h5 className="day">{props.day0}</h5>
                <div className="day_icon"><img src={`http://openweathermap.org/img/wn/${props.icon0}.png`} alt="icon"/></div>
                <h5 className="day_temp">{`${Math.round(props.temp0)}°C`}</h5>
            </div>
        </div>
    )
}
